import React from 'react';
import { Link } from 'react-router-dom';

function NotFound() {
    return (
        <div>
            <h1 style={{color:'#e84393', margin: '20px'}}>Sorry, that page is not found =( </h1>
            <Link to='/home'>Go back</Link>
        </div>
    )
}

export default NotFound;
